import React from "react";

const Rank = ({ name, entries }) => {
  return (
    <div>
      <div className="black f3">
        {`${name}, currently your entry count is...`}
      </div>
      <div className="red solid f1">{entries}</div>
    </div>
  );
};

export default Rank;
